import React from 'react';
import logo from './logo.svg';
import './App.css';
import AnimatedSwitch from './AnimatedSwitch';
import {Router} from 'react-router-dom'

function App() {
  return (
    <div className="App">
      <BrowserRouter>
      <AnimatedSwitch />
      </BrowserRouter>
    </div>
  );
}

export default App;
